PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `beer_styles` (
   `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
 ,  `name` varchar(100) NOT NULL
 );
CREATE TABLE IF NOT EXISTS `breweries` (
   `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
 ,  `name` varchar(100) NOT NULL
 ,  `website` varchar(100) DEFAULT NULL
 ,  `geo_id` integer NOT NULL
 ,  `old_id` varchar(100) DEFAULT NULL
 , `search_name` text NOT NULL
 , "country_cca2" text NOT NULL
 ,  UNIQUE (`name`,`geo_id`)
--  ,  CONSTRAINT `fk_geo_id` FOREIGN KEY (`geo_id`) REFERENCES `cities` (`id`)
 );
CREATE TABLE IF NOT EXISTS `beers` (
   `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
 ,  `brand` varchar(100) NOT NULL
 ,  `type` varchar(100) DEFAULT NULL
 ,  `old_style` varchar(100) DEFAULT NULL
 ,  `style_id` integer DEFAULT (1)
 ,  `brewery_id` integer DEFAULT NULL
 ,  `is_active` integer DEFAULT '0'
 ,  `created_at` datetime NOT NULL
 ,  `updated_at` datetime DEFAULT NULL
 ,  `old_image_ids` varchar(200) DEFAULT NULL
 , `search_name` text NOT NULL,  CONSTRAINT `fk_beer_style_id` FOREIGN KEY (`style_id`) REFERENCES `beer_styles` (`id`)
 ,  CONSTRAINT `fk_brewery_id` FOREIGN KEY (`brewery_id`) REFERENCES `breweries` (`id`)
 );
CREATE TABLE IF NOT EXISTS `beer_medias` (
   `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
 ,  `media_id` integer NOT NULL
 ,  `beer_id` integer NULL
 ,  `type` integer NOT NULL
 ,  `slot_id` text DEFAULT NULL
 ,  UNIQUE (`slot_id`)
 ,  CONSTRAINT `fk_beer_id` FOREIGN KEY (`beer_id`) REFERENCES `beers` (`id`) ON DELETE CASCADE
 ,  CONSTRAINT `fk_media_id` FOREIGN KEY (`media_id`) REFERENCES `media_items` (`id`)
 ,  CONSTRAINT `fk_beer_media_type_id` FOREIGN KEY (`type`) REFERENCES `beer_media_types` (`id`)
 );
CREATE TABLE IF NOT EXISTS `media_items` (
   `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
 ,  `external_filename` char(36) NOT NULL
 ,  `original_filename` varchar(100) NOT NULL
 ,  `content_type` varchar(10) NOT NULL
 ,  `hash` varchar(50) NOT NULL
 ,  `created_at` datetime NOT NULL
 ,  `updated_at` datetime DEFAULT NULL
 ,  `size` integer NOT NULL
 ,  `width` integer NOT NULL
 ,  `height` integer NOT NULL);
CREATE TABLE IF NOT EXISTS `beer_media_types` (
   `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
 ,  `name` varchar(100) NOT NULL
 );
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX ux_beer_id_media_id ON beer_medias (media_id, ifnull(beer_id, 0));
CREATE UNIQUE INDEX ux_hash ON media_items (hash);
CREATE INDEX "idx_beer_medias_fk_beer_id" ON "beer_medias" (`beer_id`);
CREATE INDEX "idx_beers_fk_brewery_id" ON "beers" (`brewery_id`);
CREATE INDEX "idx_beers_fk_beer_style_id" ON "beers" (`style_id`);
CREATE INDEX "idx_breweries_fk_geo_id" ON "breweries" (`geo_id`);
COMMIT;
